// frontend/src/pages/History.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const History = () => {
  const [flightLogs, setFlightLogs] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Fetch flight logs from the backend API
    const fetchFlightLogs = async () => {
      try {
        const response = await axios.get('/api/flight-history/history');
        setFlightLogs(response.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching flight logs:', error);
        setLoading(false);
      }
    };

    fetchFlightLogs();
  }, []);

  if (loading) return <p>Loading...</p>;

  return (
    <div>
      <h1>Flight History</h1>
      <table>
        <thead>
          <tr>
            <th>Drone ID</th>
            <th>Start Time</th>
            <th>End Time</th>
            <th>Max Altitude</th>
            <th>Average Speed</th>
            <th>Distance Traveled</th>
          </tr>
        </thead>
        <tbody>
          {flightLogs.map((log) => (
            <tr key={log._id}>
              <td>{log.drone_id}</td>
              <td>{log.flight_summary.start_time}</td>
              <td>{log.flight_summary.end_time}</td>
              <td>{log.flight_summary.max_altitude} m</td>
              <td>{log.flight_summary.average_speed} m/s</td>
              <td>{log.flight_summary.distance_traveled} m</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default History;
